INSERT INTO `berita` VALUES (1, 'N1001', 'Tips Ibu Menyusui', 'Tips menyusui yang paling utama agar Anda dan si buah hati merasa nyaman adalah memperhatikan posisi menyusui. Dilansir dari Livescience, menurut Debbie Pierce, seorang konsultan menyusui di Kaiser Permanente Colorado, para ibu dianjurkan untuk mencoba berbagai posisi menyusui untuk mencegah berbagai masalah yang dapat terjadi pada payudara saat menyusui berlangsung.', 'ibu-menyusui.jpg', 'https://play.google.com/store/apps/details?id=com.swamedia.klinikmutiara.booking', 0, NULL, NULL, '2019-07-02 08:50:46');
