-- ----------------------------
-- Procedure structure for insert_antrian
-- ----------------------------
DROP PROCEDURE IF EXISTS `insert_antrian`;
delimiter ;;
CREATE PROCEDURE `insert_antrian`(IN `pin_kodebooking` INT (10),
  IN `pin_idkeluarga` INT (10),
  IN `pin_tanggalpraktek` VARCHAR (191),
  IN `pin_hari` VARCHAR (10),
  IN `pin_jampraktek_awal` TIME (6),
  IN `pin_jampraktek_akhir` TIME (6),
  IN `pin_dokter` INT (10),
  IN `pin_idpoliklinik` INT (10),
  IN `pin_status` INT (10),
  IN `pin_idpasien` INT (10))
BEGIN
  DECLARE vidpraktek INT;
  DECLARE aidpraktek INT;
  DECLARE currentantrian INT;
  DECLARE newantrian INT;
  DECLARE vintervalantrian INT;
  DECLARE currentjamkedatangan TIME(6);
  DECLARE newjamkedatangan TIME(6);
  
  SELECT
    ap.id INTO vidpraktek
  FROM
    jadwalpraktek AS ap
  WHERE ap.status = 1
    AND ap.jampraktek_awal = pin_jampraktek_awal
    AND ap.jampraktek_akhir = pin_jampraktek_akhir
    AND ap.dokter = pin_dokter
    AND ap.idpoliklinik = pin_idpoliklinik
    AND ap.hari = pin_hari;
    
  IF vidpraktek != '' THEN
  
	IF pin_status = -1 OR pin_status = 1 THEN
	
		SELECT interval_antrian INTO vintervalantrian
		FROM poliklinik
		WHERE id = pin_idpoliklinik;
		
		SELECT a.idpraktek, max(a.noantrian), max(a.jam_kedatangan) INTO aidpraktek, currentantrian, currentjamkedatangan
		FROM antrian AS a
		WHERE a.idpraktek = vidpraktek
		AND a.tanggalpraktek = pin_tanggalpraktek;
		
		IF aidpraktek = '' OR aidpraktek IS NULL THEN		
			SET newantrian = 1;
			SET newjamkedatangan = pin_jampraktek_awal + INTERVAL vintervalantrian MINUTE;			
		else 			
			SET newantrian = currentantrian + 1;
			SET newjamkedatangan = currentjamkedatangan + INTERVAL vintervalantrian MINUTE;
		END IF;
		
			tanggalpraktek,
			kodebooking,
			idpraktek,
			idpasien,
			idkeluarga,
			noantrian,
			jam_kedatangan,
			created_by,
			created_at,
			updated_at
		) VALUES (
			pin_tanggalpraktek,
			pin_kodebooking,
			vidpraktek,
			pin_idpasien,
			pin_idkeluarga,
			newantrian,
			newjamkedatangan,
			pin_idpasien,
			NOW(),
			NOW()
		);
    
	END IF;
    
  END IF;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for jumlahkunjungan_pasien
-- ----------------------------
DROP PROCEDURE IF EXISTS `jumlahkunjungan_pasien`;
delimiter ;;
CREATE PROCEDURE `jumlahkunjungan_pasien`(pin_limit INT)
BEGIN
		SELECT a.created_at, a.created_by,b.name AS namapasien, b.image AS fotopasien, b.telephone, b.email, COUNT(*) AS jmlKunjungan
		FROM transaksibookings a, users b
		WHERE
			MONTH(a.created_at) = MONTH(CURRENT_DATE()) AND
			a.`created_by`=b.`id`
		GROUP BY a.created_by,namapasien, a.created_at
		ORDER BY jmlKunjungan DESC LIMIT pin_limit;
    END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for mart_booking
-- ----------------------------
DROP PROCEDURE IF EXISTS `mart_booking`;
delimiter ;;
CREATE PROCEDURE `mart_booking`()
BEGIN
		
	DECLARE done INT DEFAULT FALSE;
	DECLARE JumlahBooking 			INT;
	DECLARE JumlahCancel 			INT;
	DECLARE JumlahKonfirmasiAkanDatang 	INT;
	DECLARE JumlahKonfirmasiWalkin 		INT;  
	declare mingguskr			int;
	
		
	
		
	DECLARE cur1 CURSOR FOR   
			SELECT 
				MAX(IF(aa.stat="Pemesanan",aa.jumlah,"0")) AS JumlahBooking,
				MAX(IF(aa.stat="Batal",aa.jumlah,"0")) AS JumlahCancel,
				MAX(IF(aa.stat="Menunggu konfirmasi klinik",aa.jumlah,"0")) AS JumlahKonfirmasiAkanDatang,
				MAX(IF(aa.stat="Telah dikonfirmasi klinik",aa.jumlah,"0")) AS JumlahKonfirmasiWalkin
			FROM
				(
						SELECT a.xs1 AS stat, IFNULL(bb.jumlah,0) AS jumlah
						FROM params a
						LEFT JOIN
							(
								SELECT b.xs1,`status`,COUNT(*) AS jumlah
								FROM transaksibookings a
								LEFT JOIN params b ON b.xn1=a.`status`
								WHERE 
								      WEEKOFYEAR(a.`created_at`)= WEEKOFYEAR(NOW())
								GROUP BY `status`,b.xs1
							)bb ON bb.status = a.`xn1`
						WHERE
						    a.keterangan ="statusBooking"
				)aa
			;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;			
	
	SELECT MAX(`week`) AS mingguterakhir INTO mingguskr
	FROM mart_booking
	WHERE
		`year` = DATE_FORMAT(NOW(),"%Y")
	;
	
	
	
	OPEN cur1;		
		
		ins_loop: LOOP
				FETCH cur1 INTO
					JumlahBooking,
					JumlahCancel,
					JumlahKonfirmasiAkanDatang,
					JumlahKonfirmasiWalkin
				;
				
				IF done THEN
					LEAVE ins_loop;
				END IF;				
				
				
				
				if mingguskr = WEEKOFYEAR(NOW()) then
				
					update mart_booking a
					set 
						a.jumlahbooking = JumlahBooking,
						a.jumlahcancel = jumlahcancel,
						a.jumlah_konfirmasi_akan_datang_user = JumlahKonfirmasiAkanDatang,
						a.jumlah_konfirmasi_kedatangan_walk_in = JumlahKonfirmasiWalkin,
						a.update_at = NOW()
						
					where
						a.week = WEEKOFYEAR(NOW());
						
				else
				
				
						jumlahbooking,
						jumlahcancel,
						jumlah_konfirmasi_akan_datang_user,
						jumlah_konfirmasi_kedatangan_walk_in,					
						`week`,
						`month`,
						`year`
					) VALUES (
						JumlahBooking,
						JumlahCancel,
						JumlahKonfirmasiAkanDatang,
						JumlahKonfirmasiWalkin,					
						WEEKOFYEAR(NOW()) ,
						DATE_FORMAT(NOW(),"%m"),
						DATE_FORMAT(NOW(),"%Y") 
					);
				end if;
					
					
					
		END LOOP ins_loop;
	CLOSE cur1;	
		
		
		
		
	END
;;
delimiter ;

