DROP PROCEDURE IF EXISTS `report_JumlahBookingPeriode`;
delimiter ;;
CREATE PROCEDURE `report_JumlahBookingPeriode`(tglAwal DATE,tglAkhir DATE)
BEGIN
	SELECT 
	MAX(IF(aa.stat="Pemesanan",aa.jumlah,"0")) AS JumlahBooking,
	MAX(IF(aa.stat="Batal",aa.jumlah,"0")) AS JumlahCancel,
	MAX(IF(aa.stat="Menunggu konfirmasi klinik",aa.jumlah,"0")) AS JumlahKonfirmasiAkanDatang,
	MAX(IF(aa.stat="Telah dikonfirmasi klinik",aa.jumlah,"0")) AS JumlahKonfirmasiWalkin,
	MAX(IF(aa.stat="Pemesanan",aa.jumlah,"0")) + MAX(IF(aa.stat="Batal",aa.jumlah,"0")) +
	MAX(IF(aa.stat="Menunggu konfirmasi klinik",aa.jumlah,"0"))+
	MAX(IF(aa.stat="Telah dikonfirmasi klinik",aa.jumlah,"0"))
	 AS total
FROM
	(
			SELECT a.xs1 AS stat, IFNULL(bb.jumlah,0) AS jumlah
			FROM params a
			LEFT JOIN
				(
					SELECT b.xs1,`status`,COUNT(*) AS jumlah
					FROM transaksibookings a
					LEFT JOIN params b ON b.xn1=a.`status`
					WHERE 					      
					      a.`created_at` BETWEEN DATE(tglAwal) AND DATE(tglAkhir)
					GROUP BY `status`,b.xs1
				)bb ON bb.status = a.`xn1`
			WHERE
			    a.keterangan ="statusBooking"
	)aa;
    END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for report_JumlahTrxAll
-- ----------------------------
DROP PROCEDURE IF EXISTS `report_JumlahTrxAll`;
delimiter ;;
CREATE PROCEDURE `report_JumlahTrxAll`(tglAwal DATE,tglAkhir DATE)
BEGIN
	
		SELECT a.kodebooking,
			c.`namapoliklinik`,
			tanggalbooking,
			jampraktek_awal AS jampraktek,
			a.created_at AS tanggalTransaksi
		FROM transaksibookings a
		LEFT JOIN params b ON b.xn1=a.`status`
		LEFT JOIN `poliklinik` c ON a.`idpoliklinik`=c.`id`
		WHERE 
		       a.`created_at` BETWEEN DATE(tglAwal) AND DATE(tglAkhir)
		       AND b.keterangan ="statusBooking"
		     ORDER BY a.created_at;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for update_antrian
-- ----------------------------
DROP PROCEDURE IF EXISTS `update_antrian`;
delimiter ;;
CREATE PROCEDURE `update_antrian`(IN `pin_kodebooking` INT (10),
  IN `pin_idkeluarga` INT (10),
  IN `pin_tanggalpraktek` VARCHAR (191),
  IN `pin_hari` VARCHAR (10),
  IN `pin_jampraktek_awal` TIME (6),
  IN `pin_jampraktek_akhir` TIME (6),
  IN `pin_dokter` INT (10),
  IN `pin_idpoliklinik` INT (10),
  IN `pin_status` INT (10),
  IN `pin_idpasien` INT (10))
BEGIN
 
	IF pin_status = -1 OR pin_status = 1 THEN
			
		UPDATE antrian
		SET
			updated_at = NOW(),
			STATUS = pin_status
		WHERE 
			kodebooking = pin_kodebooking
		;
	END IF;
	
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for update_counter_booking
-- ----------------------------
DROP PROCEDURE IF EXISTS `update_counter_booking`;
delimiter ;;
CREATE PROCEDURE `update_counter_booking`(IN `pin_tanggalpraktek` VARCHAR (191),
  IN `pin_hari` VARCHAR (10),
  IN `pin_jampraktek_awal` VARCHAR (10),
  IN `pin_jampraktek_akhir` VARCHAR (10),
  IN `pin_dokter` INT (10),
  IN `pin_idpoliklinik` INT (10),
  IN `pin_status` INT (10))
BEGIN
  DECLARE vidpraktek INT;
  DECLARE cbidpraktek INT;
  DECLARE kuotapasien INT;
  DECLARE currentsequence INT;
  DECLARE newsequence INT;
  DECLARE jadwalpraktek VARCHAR(191);
  
  SELECT
    ap.id,
    ap.kuotapasien INTO vidpraktek,
    kuotapasien
  FROM
    jadwalpraktek AS ap
  WHERE ap.status = 1
    AND ap.jampraktek_awal = pin_jampraktek_awal
    AND ap.jampraktek_akhir = pin_jampraktek_akhir
    AND ap.dokter = pin_dokter
    AND ap.idpoliklinik = pin_idpoliklinik
    AND ap.hari = pin_hari;
    
  IF vidpraktek != '' THEN
  
	IF pin_status = -1 OR pin_status = 1 OR pin_status = 99 THEN
		SELECT cb.idpraktek, cb.tanggalpraktek, cb.sequence INTO cbidpraktek, jadwalpraktek, currentsequence
		FROM counterbooking AS cb
		WHERE cb.idpraktek = vidpraktek
		AND cb.tanggalpraktek = pin_tanggalpraktek;
		
		IF currentsequence = '' OR currentsequence IS NULL THEN
			SET newsequence = 1;
		ELSEIF pin_status = 99  OR currentsequence = kuotapasien THEN
			SET newsequence = kuotapasien;
		ELSEIF pin_status = -1 THEN
			SET newsequence = currentsequence - 1;
		ELSE
			SET newsequence = currentsequence + 1;
		END IF;
		  
		IF cbidpraktek = vidpraktek AND jadwalpraktek = pin_tanggalpraktek THEN
			UPDATE counterbooking
			SET
				updated_at = NOW(),
				sequence = newsequence
			WHERE 
				idpraktek = vidpraktek
			AND
				tanggalpraktek = pin_tanggalpraktek
			;
		ELSE
				created_at,
				updated_at,
				idpraktek,
				kuota,
				sequence,
				tanggalpraktek
			) VALUES (
				NOW(),
				NOW(),
				vidpraktek,
				kuotapasien,
				newsequence,
				pin_tanggalpraktek
			);	   
		END IF;
    
	END IF;
    
  END IF;
END
;;
delimiter ;

