-- ----------------------------
DROP TRIGGER IF EXISTS `transaksibooking_after_submit`;
delimiter ;;
CREATE TRIGGER `transaksibooking_after_submit` AFTER INSERT ON `transaksibookings` FOR EACH ROW BEGIN
    
    #insert counter booking
    CALL update_counter_booking(new.tanggalbooking, new.hari, new.jampraktek_awal, new.jampraktek_akhir, new.iddokter, new.idpoliklinik, new.status);
    
    #insert antrian
    CALL insert_antrian(new.kodebooking, new.kode_keluarga, new.tanggalbooking, new.hari, new.jampraktek_awal, new.jampraktek_akhir, new.iddokter, new.idpoliklinik, new.status, new.created_by);
    
    END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table transaksibookings
-- ----------------------------
DROP TRIGGER IF EXISTS `transaksibooking_after_update`;
delimiter ;;
CREATE TRIGGER `transaksibooking_after_update` AFTER UPDATE ON `transaksibookings` FOR EACH ROW BEGIN
    
    CALL update_counter_booking(new.tanggalbooking, new.hari, new.jampraktek_awal, new.jampraktek_akhir, new.iddokter, new.idpoliklinik, new.status);
    
     #update antrian
    CALL update_antrian(new.kodebooking, new.kode_keluarga, new.tanggalbooking, new.hari, new.jampraktek_awal, new.jampraktek_akhir, new.iddokter, new.idpoliklinik, new.status, new.created_by);
    
    END
;;
delimiter ;

